{
    "components": {
        "schemas": {
            "webAPIError": {
                "properties": {
                    "createdAt": {
                        "type": "string"
                    },
                    "errorCode": {
                        "type": "integer"
                    },
                    "errorMessage": {
                        "type": "string"
                    }
                },
                "type": "object"
            },
            "webPet": {
                "properties": {
                    "category": {
                        "properties": {
                            "id": {
                                "type": "integer"
                            },
                            "name": {
                                "type": "string"
                            }
                        },
                        "type": "object"
                    },
                    "id": {
                        "type": "integer"
                    },
                    "name": {
                        "type": "string"
                    },
                    "photoUrls": {
                        "items": {
                            "type": "string"
                        },
                        "type": "array"
                    },
                    "status": {
                        "type": "string"
                    },
                    "tags": {
                        "items": {
                            "$ref": "#/components/schemas/webTag"
                        },
                        "type": "array"
                    }
                },
                "type": "object"
            },
            "webRevValue": {
                "properties": {
                    "Data": {
                        "type": "integer"
                    },
                    "Err": {
                        "type": "integer"
                    },
                    "Status": {
                        "type": "boolean"
                    }
                },
                "type": "object"
            },
            "webTag": {
                "properties": {
                    "id": {
                        "type": "integer"
                    },
                    "name": {
                        "type": "string"
                    }
                },
                "type": "object"
            }
        }
    },
    "info": {
        "contact": {
            "email": "support@swagger.io",
            "name": "API Support",
            "url": "http://www.swagger.io/support"
        },
        "description": "This is a sample server Petstore server.",
        "license": {
            "name": "Apache 2.0",
            "url": "http://www.apache.org/licenses/LICENSE-2.0.html"
        },
        "termsOfService": "http://swagger.io/terms/",
        "title": "Swagger Example API",
        "version": "1.0"
    },
    "openapi": "3.0.3",
    "paths": {
        "/file/upload": {
            "post": {
                "description": "Upload file",
                "operationId": "file.upload",
                "requestBody": {
                    "content": {
                        "multipart/form-data": {
                            "schema": {
                                "properties": {
                                    "file": {
                                        "description": "this is a test file",
                                        "format": "binary",
                                        "required": [
                                            "file"
                                        ],
                                        "type": "string",
                                        "x-formData-name": "file"
                                    }
                                },
                                "required": [
                                    "file"
                                ],
                                "type": "object"
                            }
                        }
                    }
                },
                "responses": {
                    "200": {
                        "content": {
                            "application/json": {
                                "schema": {
                                    "type": "string"
                                }
                            }
                        },
                        "description": "ok"
                    },
                    "400": {
                        "content": {
                            "application/json": {
                                "schema": {
                                    "$ref": "#/components/schemas/webAPIError"
                                }
                            }
                        },
                        "description": "We need ID!!"
                    },
                    "404": {
                        "content": {
                            "application/json": {
                                "schema": {
                                    "$ref": "#/components/schemas/webAPIError"
                                }
                            }
                        },
                        "description": "Can not find ID"
                    }
                },
                "summary": "Upload file"
            }
        },
        "/testapi/get-string-by-int/{some_id}": {
            "get": {
                "description": "get string by ID",
                "operationId": "get-string-by-int",
                "parameters": [
                    {
                        "description": "Some ID",
                        "in": "path",
                        "name": "some_id",
                        "required": true,
                        "schema": {
                            "type": "integer"
                        }
                    }
                ],
                "requestBody": {
                    "content": {
                        "application/json": {
                            "schema": {
                                "$ref": "#/components/schemas/webPet"
                            }
                        }
                    },
                    "description": "Some ID",
                    "required": true,
                    "x-originalParamName": "some_id"
                },
                "responses": {
                    "200": {
                        "content": {
                            "application/json": {
                                "schema": {
                                    "type": "string"
                                }
                            }
                        },
                        "description": "ok"
                    },
                    "400": {
                        "content": {
                            "application/json": {
                                "schema": {
                                    "$ref": "#/components/schemas/webAPIError"
                                }
                            }
                        },
                        "description": "We need ID!!"
                    },
                    "404": {
                        "content": {
                            "application/json": {
                                "schema": {
                                    "$ref": "#/components/schemas/webAPIError"
                                }
                            }
                        },
                        "description": "Can not find ID"
                    }
                },
                "summary": "Add a new pet to the store"
            }
        },
        "/testapi/get-struct-array-by-string/{some_id}": {
            "get": {
                "description": "get struct array by ID",
                "operationId": "get-struct-array-by-string",
                "parameters": [
                    {
                        "description": "Some ID",
                        "in": "path",
                        "name": "some_id",
                        "required": true,
                        "schema": {
                            "type": "string"
                        }
                    },
                    {
                        "description": "Offset",
                        "in": "query",
                        "name": "offset",
                        "required": true,
                        "schema": {
                            "type": "integer"
                        }
                    },
                    {
                        "description": "Offset",
                        "in": "query",
                        "name": "limit",
                        "required": true,
                        "schema": {
                            "type": "integer"
                        }
                    }
                ],
                "responses": {
                    "200": {
                        "content": {
                            "application/json": {
                                "schema": {
                                    "type": "string"
                                }
                            }
                        },
                        "description": "ok"
                    },
                    "400": {
                        "content": {
                            "application/json": {
                                "schema": {
                                    "$ref": "#/components/schemas/webAPIError"
                                }
                            }
                        },
                        "description": "We need ID!!"
                    },
                    "404": {
                        "content": {
                            "application/json": {
                                "schema": {
                                    "$ref": "#/components/schemas/webAPIError"
                                }
                            }
                        },
                        "description": "Can not find ID"
                    }
                }
            }
        }
    },
    "servers": [
        {
            "url": "https://://petstore.swagger.io/v2"
        }
    ]
}
